import React from 'react'
import { Link } from 'react-router-dom'

const About = () => {
  return (
    <div className = 'abt'>
      <h1>Welcome to my random word generator, built for the sole purpose of practising freestyle!!</h1>
      <p><br/>Simply click the button to generate a completely random word from the English dictionary, along with three complementary rhyming words to give you some inspiration. </p>
      <br/>
      <h2><Link to = "/" style = {{ "color": "#FFBE45" }}>Let's Go!</Link></h2>
    </div>
  );
}

export default About
